\section{Introduction}
The Synthetic PolyRule Reasoning (SPR) task involves identifying patterns in symbolic sequences governed by multiple interacting factors. Unlike simple rule-based sequence tasks, SPR data often contains relationships that go beyond purely sequential dependencies, making it challenging to discover hidden correlations among tokens. Sequence-based models (e.g., LSTMs \citep{hochreiter1997longsm} or Transformers \citep{vaswani2017attentionia}) primarily focus on positional order. However, we hypothesize that more explicit modeling of relational and structural attributes will yield stronger representations. We investigate Graph Neural Networks (GNNs), which handle node- and edge-level relationships more naturally \citep{hamilton2017inductiverl,meng2024deepmcgcnmd}. Our work focuses on converting sequences into graph structures, aiming to capture these latent relationships more effectively.

