\section{Related Work}
Numerous approaches leverage sequential models for symbolic reasoning, including RNN variants and Transformer-based architectures \citep{goodfellow2016deep,vaswani2017attentionia,hochreiter1997longsm}, but these primarily process data in a strictly linear fashion. GNNs have been explored in domains involving structural and relational data \citep{hamilton2017inductiverl,meng2024deepmcgcnmd}, including systematic reasoning tasks \citep{khalid2024systematicrr}. Moreover, specialized benchmarks have been proposed in related fields \citep{teney2019vpromab}, yet few systematically focus on symbolic poly-factor sequences like SPR. Our study builds on these lines, casting the SPR sequences into graphs to investigate whether relational modeling can exceed conventional sequence-based methods.

