\title{Leveraging Graph Neural Networks for Enhanced Synthetic PolyRule Reasoning}

\author{Anonymous}

\begin{document}

\maketitle

\begin{abstract}
We explore Graph Neural Networks (GNNs) for the Synthetic PolyRule Reasoning (SPR) task, which involves classification of symbolic sequences governed by poly-factor rules. Existing sequence-based models may overlook latent relational structures within these sequences. We represent each sequence as a graph, connecting tokens according to position, shape, and color attributes. We find that while training accuracy improves, the model struggles to generalize and fails to surpass reported state-of-the-art on color-weighted (CWA) or shape-weighted (SWA) accuracy. Our findings reveal potential overfitting, especially as complexity-weighted performance remains volatile. We suggest more specialized designs or stronger regularization to handle SPR's relational complexity.
\end{abstract}

\section{Introduction}
The Synthetic PolyRule Reasoning (SPR) task involves identifying patterns in symbolic sequences governed by multiple interacting factors. Unlike simple rule-based sequence tasks, SPR data often contains relationships that go beyond purely sequential dependencies. Sequence-based models (e.g., LSTMs \citep{hochreiter1997longsm} or Transformers \citep{vaswani2017attentionia}) focus primarily on positional order. We hypothesize that explicitly modeling relational and structural attributes can yield stronger representations. Graph Neural Networks (GNNs) process node- and edge-level relationships more naturally \citep{hamilton2017inductiverl,meng2024deepmcgcnmd}, which motivates their application to SPR. We cast sequences into graphs, aiming to better capture these latent relationships.

In our experiments, we find that although our GNN-based architecture steadily improves on training data, it struggles to maintain accuracy on validation and test sets. We observe limited or inconclusive gains over sequence-based baselines, revealing potential pitfalls in directly applying GNNs to tasks with complex factor interactions. Our contributions include a detailed empirical study of a GNN-based approach for SPR and an analysis of its observed overfitting.

\section{Related Work}
Symbolic or sequential reasoning tasks often rely on RNN variants or Transformer-based architectures \citep{goodfellow2016deep,vaswani2017attentionia,hochreiter1997longsm}, but they mainly treat data in a linear fashion. GNNs have shown promise in tasks involving structural and relational data \citep{hamilton2017inductiverl,meng2024deepmcgcnmd}, including systematic reasoning \citep{khalid2024systematicrr}. Benchmarks such as \citet{teney2019vpromab} examine visual reasoning under complex conditions, though few existing datasets comprehensively address symbolic poly-factor sequences like SPR. Our study extends this line of research, investigating whether graph-based representations exceed sequence baselines for SPR.

\section{Method}
We represent each token in the SPR sequence as a node in a graph. Edges connect (1) consecutive tokens and (2) tokens sharing the same shape or color. Node features encode shape, color, and position. We use a GraphSAGE-like framework \citep{hamilton2017inductiverl} that aggregates local neighborhood information through graph convolution layers, followed by pooling to produce a sequence-level classification. This setup encourages explicit modeling of cross-token similarities that might be overlooked by purely sequential models.

\section{Experiments}
We train and validate on the \texttt{SPR\_BENCH} dataset, partitioned into train, development, and test splits. We evaluate performance on standard accuracy, complexity-weighted accuracy, and color-/shape-weighted metrics. Despite strong training performance (e.g., training accuracies above $0.63$), validation and test metrics fluctuate, with no decisive improvement over sequence-based baselines. \cref{fig:main_curves} shows aggregated training and validation curves (loss, accuracy, and complexity-weighted accuracy) for our GNN variants and a baseline. The validation metrics remain volatile, indicating persistent overfitting and difficulty in capturing the data's relational complexity. We also explore ablations removing positional embeddings or batch normalization, but these changes lead to only marginal differences, as shown by confusion matrices in Appendix~\ref{appendixconfusions}.

