\includegraphics[width=0.9\textwidth]{group1_per_epoch_curves.png}
\caption{Aggregated training (blue and orange) and validation (green and red) curves showing loss, accuracy, and complexity-weighted accuracy for both GNN and baseline methods over training epochs. Volatility in validation metrics suggests difficulty in modeling SPR's relational complexity.}
\label{fig:main_curves}
\end{figure}

\section{Conclusion}
We investigated a GNN-based approach for SPR, seeking to exploit relational structures. While the method learns effectively on training data, the volatile validation and test metrics reveal limited real-world gains and highlight a pitfall: relational modeling can become prone to overfitting when factor interactions are intricate. Future work should investigate stronger regularization, improved data augmentation, or more specialized GNN architectures tailored to multi-factor symbolic tasks.

