\section{Hyperparameter and Implementation Details}
We used a 2-layer GNN with 64 hidden units per layer, ReLU activations, and a final linear classification head. During training, we employed cross-entropy loss and the Adam optimizer with a learning rate of $1\times 10^{-3}$. We trained for up to 50 epochs, halving the learning rate if validation accuracy did not improve for 5 epochs. Dropout was set to 0.2 after each GNN layer. While these hyperparameters worked well to reduce training loss, the validation metrics remained inconsistent, suggesting generalization challenges specific to SPR.

